import React from "react";
import io from "socket.io-client";

const namespace = "dynamic-web_test";
const client_socket = io.connect(`http://192.168.35.25:7000/${namespace}`, {
    query: `ns=/${namespace}`,
    reconnect: true,
    resource: 'socket.io'
});

client_socket.connect();

export default client_socket;
